import React from 'react';
import ReactDOM from 'react-dom';

const Hello = props => {
  return (
    <div>
      <p>
        Hello {props.name} you are {props.age} years old
      </p>
    </div>
  );
};

const App = () => {
  const name = 'Peter';
  const age = 10;
  return (
    <>
      <h1>Greetings</h1>
      <Hello name={name} age={age} />
      <Hello name={'Diana'} age={age + 10} />
    </>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));

